function RespondToTicket(){var n=$("#TicketId").val(),t={Id:$("#Status").val(),Id:$("#reason").val()};$.ajax({url:"https://localhost:44370/BuildingManager/PostRespond",type:"POST",data:n,TicketRespond:t,success:function(){alert("Success")}})}function ViewTickets(){$.ajax({url:"https://localhost:44370/MaintenanceManager/GetTickets",type:"GET",dataType:"JSON",success:OnSuccess})}function OnSuccess(n){var t=n;list=document.getElementById("TicketsList");t.forEach(n=>{li=document.createElement("li"),li.innerText=n,list.appendChild(li)})}function ViewBuilding(){$.ajax({url:"https://localhost:44370/MaintenanceManager/GetTicket",type:"GET",success:OnSuccess})}function OnSuccess(n){var t=n;$("#TicketId").html(t.Id);$("#BuildingManagerComment").html(t.BuildingManagerComment);$("#BeneficiaryID").html(t.BeneficiaryID);$("#Status").html(t.Status);$("#Date").html(t.Date);$("#Description").html(t.Description)}function ViewNewTickets(){$.ajax({url:"https://localhost:44370/MaintenanceManager/GetNewTickets",type:"GET",dataType:"JSON",success:OnSuccess})}function OnSuccess(n){var t=n;list=document.getElementById("NewTicketsList");t.forEach(n=>{li=document.createElement("li"),li.innerText=n,list.appendChild(li)})}function ViewWorkers(){$.ajax({url:"https://localhost:44370/MaintenanceManager/GetWorkers",type:"GET",dataType:"JSON",success:OnSuccess})}function OnSuccess(n){var t=n;list=document.getElementById("WorkersList");t.forEach(n=>{li=document.createElement("li"),li.innerText=n,list.appendChild(li)})}function ViewWorker(){$.ajax({url:"https://localhost:44370/MaintenanceManager/GetWorker",type:"GET",success:OnSuccess})}function OnSuccess(n){var t=n;$("#Id").html(t.Id);$("#Name").html(t.Name);$("#Phone").html(t.Phone);$("#Email").html(t.Email)}